INSERT INTO `wp_posts` VALUES (2,1,'2019-08-13 10:07:14','2019-08-13 10:07:14','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost:81/UEH/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2019-08-13 10:07:14','2019-08-13 10:07:14','',0,'http://localhost:81/UEH/?page_id=2',0,'page','',0),(3,1,'2019-08-13 10:07:14','2019-08-13 10:07:14','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://localhost:81/UEH.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2019-08-13 10:07:14','2019-08-13 10:07:14','',0,'http://localhost:81/UEH/?page_id=3',0,'page','',0),(5,1,'2016-10-17 07:58:07','2016-10-17 07:58:07','<!-- wp:paragraph -->\n<p> [otw_is sidebar=otw-sidebar-1] </p>\n<!-- /wp:paragraph -->','Courses','','publish','closed','closed','','courses','','','2019-09-18 11:43:52','2019-09-18 11:43:52','',0,'http://www.demo.acmethemes.com/education-base/?page_id=5',0,'page','',0),(15,1,'2019-08-13 10:31:50','2019-08-13 10:31:50','','WhatsApp Image 2019-08-02 at 21.57.13','','inherit','open','closed','','whatsapp-image-2019-08-02-at-21-57-13','','','2019-08-13 10:31:50','2019-08-13 10:31:50','',0,'http://localhost:81/UEH/wp-content/uploads/2019/08/WhatsApp-Image-2019-08-02-at-21.57.13.jpeg',0,'attachment','image/jpeg',0),(16,1,'2019-08-13 10:32:02','2019-08-13 10:32:02','','cropped-WhatsApp-Image-2019-08-02-at-21.57.13.jpeg','','inherit','open','closed','','cropped-whatsapp-image-2019-08-02-at-21-57-13-jpeg','','','2019-08-13 10:32:02','2019-08-13 10:32:02','',0,'http://localhost:81/UEH/wp-content/uploads/2019/08/cropped-WhatsApp-Image-2019-08-02-at-21.57.13.jpeg',0,'attachment','image/jpeg',0),(19,1,'2019-08-13 10:39:26','2019-08-13 10:39:26','<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"customFontSize\":15} -->\n<p style=\"font-size:15px\" class=\"has-text-color has-very-dark-gray-color\"><strong>UNIVERSAL EDUCATION HUB</strong>  is trust registered under the India Trust Act, 1882 with Registration Number IV-010100267. The Trust is formed on 2019, by Mr. Gour Bhattacharya. UNIVERSAL EDUCATION HUB(UEH) is a non-profit trust committed to provide certificates to students who are learning different types of courses in different institutes.The trust aims to provide certificates for the follwing types of courses: -</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>      Art  &amp; Painting School</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>       Dance  &amp; Song School</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>       Beauty Parlour</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>      Spoken English</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>      Vocational  Traning Centre</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>      Boutique</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>     Music &amp; Musical Instrument Training Centre</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>    Yoga &amp; Pranayam Traning Centre</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>     Any Astrologycal Traning Centre</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>     Kumphu / Karate  School</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>     Any Skill Development Centre, </strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>     Computer Traning centre</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>    Play School ( Play To UKG )</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"customFontSize\":15} -->\n<p style=\"font-size:15px;text-align:left\"><strong>     Any Job Oriented Teaching &amp; Traning Institute</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"customFontSize\":15} -->\n<p style=\"font-size:15px\" class=\"has-text-color has-very-dark-gray-color\">Currently UEH is providing certificates to more than 25 centers at different location of India. Around 100 students are enhancing their skills by learning different courses from the those centers and they will be certified by us after successful completion of the course. In the coming years we will tie up with many more institutes. UEH has a simple aim, it is to provide certificates to all students who have engaged themselves to enhance their skills by enrolling in different institutes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2><strong>Our Mission</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"customFontSize\":15} -->\n<p style=\"font-size:15px\"><strong>The  mission of UEH TRUST are :-</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"customFontSize\":15} -->\n<p style=\"font-size:15px\"><strong>To serve the Society by providing Quality certficates to students based on their skill set.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"customFontSize\":15} -->\n<p style=\"font-size:15px\"><strong>To promote the importance of skill development at an early stage of a students life.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"customFontSize\":15} -->\n<p style=\"font-size:15px\"><strong>To achieve socioal-economical development in a serene and competitive environment.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"customFontSize\":15} -->\n<p style=\"font-size:15px\"><strong>To provide certficates  on all  the best skill development  courses.</strong></p>\n<!-- /wp:paragraph -->','About Us','','publish','closed','closed','','about-us','','','2019-10-15 10:01:45','2019-10-15 10:01:45','',0,'http://localhost:81/UEH/?page_id=19',0,'page','',0),(21,1,'2019-08-13 10:39:27','2019-08-13 10:39:27','','Our Courses','','publish','closed','closed','','our-courses','','','2019-08-13 10:39:27','2019-08-13 10:39:27','',0,'http://localhost:81/UEH/?page_id=21',0,'page','',0),(22,1,'2019-08-13 10:39:27','2019-08-13 10:39:27','<!-- wp:paragraph -->\n<p> &nbsp;[pt_view id=\"f14ec33yzt\"]</p>\n<!-- /wp:paragraph -->','Our Franchise','','publish','closed','closed','','franchise-under-ueh','','','2019-10-16 08:39:54'