through online We are constantly working to move our entire process flow to be done through online. Once we achieve our 100% goal we will get following benefits.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\"><strong>Global access, 24 hours a day, 7 days a week</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\"><strong>Improved service through greater flexibility</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\"><strong>Cost savings</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\"><strong>Faster delivery of services &amp; products</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\"><strong>Increased professionalism</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\"><strong>Less paper waste</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\"><strong>Opportunities to manage your business from anywhere in the world.</strong></p>\n<!-- /wp:paragraph -->','Online Solutions','','publish','closed','closed','','online-solutions','','','2019-08-15 16:24:52','2019-08-15 16:24:52','',338,'http://demo.acmethemes.com/education-base-pro/?page_id=394',0,'page','',0),(396,1,'2017-03-06 06:00:44','2017-03-06 06:00:44','<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\"><strong>Quality education</strong>enables people to develop all of their attributes and skills to achieve their potential as human beings and members of society. <strong>Quality education</strong>provides the foundation for equity in society.<strong>Quality education</strong>is one of the most basic public services. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\">Institutes are providing <strong>Quality Education</strong> and we at UEH are constantly monitoring their quality and we are providing certificates with and worldwide exit gate for those childrens and youth.</p>\n<!-- /wp:paragraph -->','Quality Education','','publish','closed','closed','','quality-education','','','2019-08-15 16:11:51','2019-08-15 16:11:51','',338,'http://demo.acmethemes.com/education-base-pro/?page_id=396',0,'page','',0),(397,1,'2017-03-06 06:14:23','2017-03-06 06:14:23','<!-- wp:heading {\"level\":4} -->\n<h4><strong>Universal Education Hub is an ISO 9001:2015 certified organization.</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\">ISO 9001 is defined as the international standard that specifies requirements for a&nbsp;<a href=\"https://asq.org/quality-resources/quality-management-system\">quality management system (QMS)</a>. Organizations use the standard to demonstrate the ability to consistently provide products and services that meet customer and regulatory requirements. It is the most popular standard in the&nbsp;<a href=\"https://asq.org/quality-resources/iso-9000\">ISO 9000 series</a>&nbsp;and the only standard in the series to which organizations can certify.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\">ISO 9001 was first published in 1987 by the&nbsp;<a href=\"https://asq.org/quality-resources/standards-101#iso\">International Organization for Standardization (ISO)</a>, an international agency composed of the national standards bodies of more than 160 countries. The&nbsp;<a href=\"https://asq.org/quality-press/display-item?item=T1040\">current version of ISO 9001</a>&nbsp;was released in September 2015.</p>\n<!-- /wp:paragraph -->','ISO Certified','','publish','closed','closed','','iso-certified','','','2019-08-17 14:44:54','2019-08-17 14:44:54','',338,'http://demo.acmethemes.com/education-base-pro/?page_id=397',0,'page','',0),(405,1,'2017-03-28 04:30:29','2017-03-28 04:30:29','<label> Your Name (required)\n    [text* your-name] </label>\n\n<label> Your Email (required)\n    [email* your-email] </label>\n\n<label> Subject\n    [text your-subject] </label>\n\n<label> Your Message\n    [textarea your-message] </label>\n\n[submit \"Send\"]\n1\nEducation Base \"[your-subject]\"\n[your-name] <wordpress@demo.acmethemes.com>\nacmethemes@gmail.com\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on Education Base (http://www.demo.acmethemes.com/education-base)\nReply-To: [your-email]\n\n\n\n\nEducation Base \"[your-subject]\"\nEducation Base <wordpress@demo.acmethemes.com>\n[your-email]\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on Education Base (http://www.demo.acmethemes.com/education-base)\nReply-To: acmethemes@gmail.com\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your mes