evision-v1','','','2019-08-14 11:34:31','2019-08-14 11:34:31','',500,'http://ueh.org.in/index.php/2019/08/14/500-revision-v1/',0,'revision','',0),(571,1,'2019-08-15 08:12:43','2019-08-15 08:12:43','<!-- wp:paragraph -->\n<p><strong>UNIVERSAL EDUCATION HUB</strong>  is trust registered under the India Trust Act, 1882 with Registration Number IV-010100267. The Trust is formed on 2019, by Mr. Gour Bhattacharya. UNIVERSAL EDUCATION HUB(UEH) is a non-profit trust committed to provide certificates to students who are learning different types of courses in different institutes.The trust aims to provide certificates for the follwing types of courses: -</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">      Art  &amp; Painting School</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">       Dance  &amp; Song School</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">       Beauty Parlour</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">      Spoken English</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">      Vocational  Traning Centre</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">      Boutique</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">     Music &amp; Musical Instrument Training Centre</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">    Yoga &amp; Pranayam Traning Centre</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">     Any Astrologycal Traning Centre</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">     Kumphu / Karate  School</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">     Any Skill Development Centre, </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">     Computer Traning centre</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">    Play School ( Play To UKG )</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p style=\"text-align:left\">     Any Job Oriented Teaching &amp; Traning Institute</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Currently UEH is providing certificates to more than 25 centers at different location of Bankura. Around 100 students are enhancing their skills by learning different courses from the those centers and they will be certified by us after successful completion of the course.In the coming years we will tie up with many more institutes. UEH has a simple aim, it is to provide certificates to all students who have engaged themselves to enhance their skills by enrolling in different institutes.</h4>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Mission</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The  mission of UEH TRUST are :-</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To serve the Society by providing Quality certficates to students based on their skill set.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To promote the importance of skill development at an early stage of a students life.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To achieve socio-economical development in a serene and competitive environment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To provide certficates  on all  the best skill development  courses.</p>\n<!-- /wp:paragraph -->','About Us','','inherit','closed','closed','','19-revision-v1','','','2019-08-15 08:12:43','2019-08-15 08:12:43','',19,'http://u