g/quality-press/display-item?item=T1040\">current version of ISO 9001</a>was released in September 2015.','ISO Certified','','inherit','closed','closed','','397-revision-v1','','','2019-08-15 16:02:55','2019-08-15 16:02:55','',397,'http://ueh.org.in/index.php/2019/08/15/397-revision-v1/',0,'revision','',0),(600,1,'2019-08-15 16:04:11','2019-08-15 16:04:11','\n\n<!-- wp:heading {\"level\":4} -->\n<h4><strong>Universal Education Hub is an ISO 9001:2015 certified organization.</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">ISO 9001 is defined as the international standard that specifies requirements for a&nbsp;<a href=\"https://asq.org/quality-resources/quality-management-system\">quality management system (QMS)</a>. Organizations use the standard to demonstrate the ability to consistently provide products and services that meet customer and regulatory requirements. It is the most popular standard in the&nbsp;<a href=\"https://asq.org/quality-resources/iso-9000\">ISO 9000 series</a>&nbsp;and the only standard in the series to which organizations can certify.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"normal\"} -->\n<p class=\"has-normal-font-size\">ISO 9001 was first published in 1987 by the&nbsp;<a href=\"https://asq.org/quality-resources/standards-101#iso\">International Organization for Standardization (ISO)</a>, an international agency composed of the national standards bodies of more than 160 countries. The&nbsp;<a href=\"https://asq.org/quality-press/display-item?item=T1040\">current version of ISO 9001</a>&nbsp;was released in September 2015.</p>\n<!-- /wp:paragraph -->','ISO Certified','','inherit','closed','closed','','397-revision-v1','','','2019-08-15 16:04:11','2019-08-15 16:04:11','',397,'http://ueh.org.in/index.php/2019/08/15/397-revision-v1/',0,'revision','',0),(601,1,'2019-08-15 16:05:03','2019-08-15 16:05:03','\n\n<!-- wp:heading {\"level\":4} -->\n<h4><str